import React, {Component} from "react"
import "./Uslugi.css"
import {translate} from "react-switch-lang";
import {Container, Card, CardDeck} from "react-bootstrap";




class Uslugi extends Component {
    state = {
        id:"0"
    }
    render() {
        const {t} = this.props;
        return (
            <Container fluid={true} className={"practica"}>
            <Container fluid={'sm'} className={"uslugi"} id={this.props.id}>
                <div className={"pt-5"}>
                    <h1 className="text-center text-dark">{t('header.section3.title')}</h1>
                </div>
            </Container>

            </Container>
        )
    }
}
export default translate(Uslugi)
